import { createRouter, createWebHashHistory } from 'vue-router';
import HomeView from '../views/HomeView.vue';
import AllChocolates from '../views/AllChocolates.vue'; // Dodao sam import za AllChocolates.vue

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/allchocolates', // Dodao sam putanju za listu 훾okolada
    name: 'allchocolates',
    component: AllChocolates // Dodao sam komponentu za listu 훾okolada
  },
  {
    path: '/editchocolate/:id',
    name: 'editchocolate',
    component: () => import(/* webpackChunkName: "editchocolate" */ '../views/EditChocolate.vue'),
    props: true
  }
];

const router = createRouter({
  history: createWebHashHistory(),
  routes
});

export default router;
